import { SmallCard } from './components/SmallCard/SmallCard';

const pageSection1 = {
  titulo: "Titulo"

}
function App() {
  return (
    <div className="App">
      <PageSection titulo={pageSection1.titulo} />
      <BigCard/>
      <SmallCard/>
      <SmallCard/>
      <ImageButton/>
    </div>
  );
}

